description:
Caprice has been wanting to introduce her American friend Jenna to her Austrian lover Marcello, so when the opportunity presented itself at the Brazilian Erotic Festival, these sexy people were up for the very special treat. So after drinks at their upscale hotel's cocktail lounge that evening, they move to their suite, where the sexy magic happens :-) The chemistry between these three is unparalleled. Trust me, you will LOVE the passion...and the view! The only uneasiness in watching this sexcapade is trying to decide whose place you'd want to be in ;-)

